<?xml version="1.0" encoding="UTF-8" ?>
<?xml-stylesheet type="text/xsl" href="/callimachus/manifest?template"?>
<html xmlns="http://www.w3.org/1999/xhtml"
	xmlns:rdf="http://www.w3.org/1999/02/22-rdf-syntax-ns#" xmlns:rdfs="http://www.w3.org/2000/01/rdf-schema#"
	xmlns:owl="http://www.w3.org/2002/07/owl#" xmlns:calli="http://callimachusproject.org/rdf/2009/framework#">
<head>
	<title about="?this">{rdfs:label}</title>
</head>
<body about="?this">
	<h1>
		<a property="rdfs:label" href="?this" />
	</h1>
	<ul class="aside">
		<li rel="rdfs:isDefinedBy">
			<a about="?isDefinedBy" property="rdfs:label" href="?isDefinedBy"></a>
		</li>
		<li rev="calli:createRel" class="optional">
			<label>Relationship</label>
			<div about="?createRel" typeof="owl:Class">
				<a href="?createRel" property="rdfs:label" class="view" />
			</div>
		</li>
		<li rev="calli:createRev" class="optional">
			<label>Reverse relationship</label>
			<div about="?createRev" typeof="owl:Class">
				<a href="?createRev" property="rdfs:label" class="view" />
			</div>
		</li>
	</ul>
	<pre property="rdfs:comment" class="wiki"></pre>
</body>
</html>
